import react,{Component} from "react";

class ClassComponent extends react.Component{
   constructor(){
      super()
     this.state={
      name:"Naresh",
     }
   }
    handleName =()=>{
      this.setState(name='hello')
    } 
   render(){
      return(
         <div>
{this.state.name}
<button onClick={this.handleName}>Change Name</button>
         </div>
      )
   }

      
   
}
export default ClassComponent
